import React, { Component } from 'react'
import Header from './../assets/image2.png';
import { Box } from '@material-ui/core';
export default class HeaderFile extends Component {
    render() {
        return (
            <Box>
                <img src={Header} alt="logos" style={{ width: '100%' }} />
            </Box>
        )
    }
}
